import './App.css';
import React, {  useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './components/HomePage';

function App() {





  return (
    <div className="App">
      <Router>
         <Routes>
            <Route path='/' element ={<HomePage/>}/>

         </Routes> 
      </Router>
    </div>
  );
}

export default App;
